import styled from "styled-components";
import Motor from "../Motor/Motor";


const Container = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 1rem;
`


function MotorTable() {
    return(
        <Container>
            <Motor/>
        </Container>
    )
}

export default MotorTable;
